import React, { useState } from "react";
import Navbar from "../../Components/navbar/Navbar";
import "./payment_css/Payment.css";

const Payment: React.FC = () => {
  const [selectedMethod, setSelectedMethod] = useState("");
  const [amount, setAmount] = useState(10000); // Số tiền thanh toán (ví dụ: 10,000 VND)

  const handlePayment = async () => {
    if (selectedMethod === "momo") {
      try {
        const response = await fetch("https://test-payment.momo.vn/v2/gateway/api/create", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            partnerCode: "MOMO",
            accessKey: "F8BBA842ECF85",
            secretKey: "K951B6PE1waDMi640xX08PD3vg6EkVlz",
            requestId: `${Date.now()}`,
            amount: amount.toString(),
            orderId: `${Date.now()}`,
            orderInfo: "Thanh toán vé xe",
            returnUrl: "http://localhost:3000/payment-success",
            notifyUrl: "http://localhost:3000/payment-notify",
            extraData: "",
          }),
        });

        const data = await response.json();
        if (data.payUrl) {
          window.location.href = data.payUrl;
        } else {
          alert("Không thể tạo giao dịch thanh toán. Vui lòng thử lại.");
        }
      } catch (error) {
        console.error("Error during payment:", error);
        alert("Đã xảy ra lỗi khi thanh toán. Vui lòng thử lại.");
      }
    } else if (selectedMethod === "shopee") {
      try {
        const response = await fetch("https://api.shopeepay.vn/payment", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            partnerCode: "SHOPEEPAY",
            accessKey: "YOUR_SHOPEEPAY_ACCESS_KEY",
            secretKey: "YOUR_SHOPEEPAY_SECRET_KEY",
            requestId: `${Date.now()}`,
            amount: amount.toString(),
            orderId: `${Date.now()}`,
            orderInfo: "Thanh toán vé xe",
            returnUrl: "http://localhost:3000/payment-success",
            notifyUrl: "http://localhost:3000/payment-notify",
            extraData: "",
          }),
        });

        const data = await response.json();
        if (data.payUrl) {
          window.location.href = data.payUrl;
        } else {
          alert("Không thể tạo giao dịch thanh toán. Vui lòng thử lại.");
        }
      } catch (error) {
        console.error("Error during payment:", error);
        alert("Đã xảy ra lỗi khi thanh toán. Vui lòng thử lại.");
      }
    } else {
      alert("Vui lòng chọn phương thức thanh toán.");
    }
  };

  return (
    <>
      <Navbar />
      <div className="payment">
        <h2>Thanh toán vé</h2>
        <p>Vui lòng chọn phương thức thanh toán</p>
        <div className="payment-methods">
          <label>
            <input
              type="radio"
              name="paymentMethod"
              value="momo"
              onChange={(e) => setSelectedMethod(e.target.value)}
            />
            Ví điện tử Momo
          </label>
          <label>
            <input
              type="radio"
              name="paymentMethod"
              value="shopee"
              onChange={(e) => setSelectedMethod(e.target.value)}
            />
            Ví điện tử ShopeePay
          </label>
          <label>
            <input
              type="radio"
              name="paymentMethod"
              value="bank"
              onChange={(e) => setSelectedMethod(e.target.value)}
            />
            Thẻ ngân hàng
          </label>
          <label>
            <input
              type="radio"
              name="paymentMethod"
              value="cash"
              onChange={(e) => setSelectedMethod(e.target.value)}
            />
            Thanh toán khi nhận vé
          </label>
        </div>
        <button onClick={handlePayment} disabled={!selectedMethod}>
          Xác nhận thanh toán
        </button>
      </div>
    </>
  );
};

export default Payment;


